export default class Timer extends Component {
    constructor(props) {
        super(props)

        this.state = {
             clock: 0
        }
    }

    render() {
        return (
            <div>
                <p>You visite this website since</p>
        <span>{this.state.clock}</span>
            </div>
        )
    }
}
